		}

		function getIndex(arr){
			var greatest = arr[0];
			var index = 0;
			arr.forEach(function(item,i){
			if(item > greatest)
				greatest = item, index = i;
			});
			if(index==9)
				index=-1;
			return index;
		}

		function answer() {
			sum=0;
			for(i=0; i<points.length; i++) {
				ans[Math.floor(points[i][1]/40)*10+Math.floor(points[i][0]/40)]=1;
			}
			alert("Система считает, что введён символ: "+(getIndex(net.run(ans))+1));
			for(i=0; i<num; i++) {
				ans[i] = 0;
			}
			points = [];
			ctx.clearRect(0, 0, 400, 400);
		}

		$(document).ready(function() {
			cvs = document.getElementById('canvas');
			ctx = cvs.getContext('2d');
			ctx.fillStyle = 'black';
			ctx.lineWidth = 20;

			cvs.addEventListener('mousemove', function(e) {
				if(mouseDown) {
					var PosX = e.clientX-(($(window).width()/2)-200), PosY = e.clientY-146;
					ctx.lineTo(PosX, PosY);
					ctx.stroke();

					ctx.beginPath();
					ctx.arc(PosX, PosY, 10, 0, Math.PI*2);
					ctx.fill();

					ctx.beginPath();
					ctx.moveTo(PosX, PosY);
					points.push([PosX, PosY]);
				}
			});

			cvs.addEventListener('mousedown', function(e) {
				mouseDown = true;
			});

			cvs.addEventListener('mouseup', function(e) {
				mouseDown = false;
				ctx.beginPath();
			});
		});

		$(document).keypress(function(e) {
			if(e.which == 13) 
				answer();
		});
		
		function useReadyModel() {
			console.log(document.querySelector("#rmodel").value);
			net.fromJSON(JSON.parse(document.querySelector("#rmodel").value));
